import styled from "styled-components";

export const Item = styled.div`
  height: 100%;
  width: 100%;
  display: flex;
  align-items: center;
  flex-direction: column;
  justify-content: center;
`;
export const ImgItem = styled.img`
  max-width: 150px;
  max-height: 150px;
  padding: 200px;
`;
export const HeroSlides = styled.div``;
